import { Link } from "react-router-dom";
import './style.css';

function Navigation() {



    const nav = useNavigate();


    const hamberug = () => {


        nav('/')

    }

    return (<div>





        <div style={{ marginTop: "75px" }}>

            <h2 class="h2">HOME</h2>
            <br></br>
            <h2 class="h2">ABOUT</h2>
            <br></br>
            <h2 class="h2">RESUME</h2>
            <br></br>
            <h2 class="h2">BEHANCE</h2>
            <br></br>
            <h2 class="h2">PHOTOGRAPHY</h2>
            <br></br>
            <h2 class="h2">FOR FUN</h2>
        </div>

        <div>
            <button className="x" style={{fontSize:"43px",marginRight:"40px",marginBottom:"20px",marginTop:"-511px"}} 
             onClick={hamberug}
              class="close" aria-label="Close">
                  X
            </button>
        </div>




    </div>)
}

export default Navigation;
